{"value":"black"},"text_font_size":{"value":"6pt"},"x":{"field":"tm_text_x"},"y":{"field":"tm_text_y"}},"id":"15180","type":"Text"},{"attributes":{},"id":"15261","type":"UnionRenderers"},{"attributes":{"callback":null,"data":{"x":[1,1,129,229,129],"y":[802.5,807.5,807.5,805.0,802.5]},"selected":{"id":"16865","type":"Selection"},"selection_policy":{"id":"16864","type":"UnionRenderers"}},"id":"14373","type":"ColumnDataSource"},{"attributes":{"callback":null,"data":{"Family":[110,109,107,100,106,99,102,92,95,101,65,94,89,59,91,90,8,19,20,15,74,16,14,96,11,81,40,75,35,76,53,86,87,82,39,66,108,105,45,71,37,30,51,83,50,56,57,63,104,103,79,70,7,6,5,4,2,13,33,21,69,46,9,54,72,73,10,3,64,31,12,17,48,49,52,55,58,60,61,62,67,68,77,80,84,85,88,93,98,47,78,44,28,27,18,22,23,24,25,26,29,43,32,34,36,38,41,42,1,97],"Frequency":[98.3,92.1,80.3,47.6,47.2,35.4,25.3,20.5,16.2,11.4,7.9,5.2,4.8,4.8,4.8,3.9,3.9,3.5,3.1,3.1,3.1,3.1,3.1,2.6,2.6,2.6,2.2,1.7,1.7,1.7,1.7,1.7,1.7,1.7,1.7,1.7,1.7,1.7,1.3,1.3,1.3,1.3,1.3,1.3,1.3,1.3,1.3,1.3,1.3,1.3,1.3,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.9,0.4],"Function":["A probable RNA chaperone. Forms a complex with KhpB which binds to cellular RNA and controls its expression. Plays a role in peptidoglycan (PG) homeostasis and cell length regulation","","Involved in targeting and insertion of nascent membrane proteins into the cytoplasmic membrane. Binds to the hydrophobic signal sequence of the ribosome-nascent chain (RNC) as it emerges from the ribosomes. The SRP-RNC complex is then targeted to the cytoplasmic membrane where it interacts with the SRP receptor FtsY","Specifically methylates guanosine-37 in various tRNAs","An accessory protein needed during the final step in the assembly of 30S ribosomal subunit, possibly for assembly of the head region. Essential for efficient processing of 16S rRNA. May be needed both before and after RbfA during the maturation of 16S rRNA. It has affinity for free ribosomal 30S subunits but not for 70S ribosomes","This protein is located at the 30S-50S ribosomal subunit interface and may play a role in the structure and function of the aminoacyl-tRNA binding site","Might take part in the signal recognition particle (SRP) pathway. This is inferred from the conservation of its genetic proximity to ftsY/ffh. May be a regulatory protein","","","","Endonuclease that specifically degrades the RNA of RNA-DNA hybrids","","","","","","","Catalyzes the reversible epimerization of D-ribulose 5-phosphate to D-xylulose 5-phosphate","","Involved in transcription antitermination. Required for transcription of ribosomal RNA (rRNA) genes. Binds specifically to the boxA antiterminator sequence of the ribosomal RNA (rrn) operons","Specifically methylates guanosine-37 in various tRNAs","","Digests double-stranded RNA. Involved in the processing of primary rRNA transcript to yield the immediate precursors to the large and small rRNAs (23S and 16S). Processes some mRNAs, and tRNAs when they are encoded in the rRNA operon. Processes pre-crRNA and tracrRNA of type II CRISPR loci if present in the organism","","Carrier of the growing fatty acid chain in fatty acid biosynthesis","","","May play a role in photosystem I and II biogenesis","Attaches a formyl group to the free amino group of methionyl-tRNA(fMet). The formyl group appears to play a dual role in the initiator identity of N-formylmethionyl-tRNA by promoting its recognition by IF2 and preventing the misappropriation of this tRNA by the elongation apparatus","One of the components of the core complex of photosystem II (PSII), required for its stability and/or assembly. PSII is a light-driven water:plastoquinone oxidoreductase that uses light energy to abstract electrons from H(2)O, generating O(2) and a proton gradient subsequently used for ATP formation. It consists of a core antenna complex that captures photons, and an electron transfer chain that converts photonic excitation into a charge separation","","Catalyzes the conversion of acetate into acetyl-CoA (AcCoA), an essential intermediate at the junction of anabolic and catabolic pathways. AcsA undergoes a two-step reaction. In the first half reaction, AcsA combines acetate with ATP to form acetyl-adenylate (AcAMP) intermediate. In the second half reaction, it can then transfer the acetyl group from AcAMP to the sulfhydryl group of CoA, forming the product AcCoA","Required for a late step of 50S ribosomal subunit assembly. Has GTPase activity","","An essential GTPase which binds GTP, GDP and possibly (p)ppGpp with moderate affinity, with high nucleotide exchange rates and a fairly low GTP hydrolysis rate. Plays a role in control of the cell cycle, stress response, ribosome biogenesis and in those bacteria that undergo differentiation, in morphogenesis control","Required for chromosome condensation and partitioning","A probable RNA chaperone. Forms a complex with KhpB which binds to cellular RNA and controls its expression. Plays a role in peptidoglycan (PG) homeostasis and cell length regulation","","","","","","Catalyzes the NAD(P)-dependent oxidation of 4-(phosphooxy)-L-threonine (HTP) into 2-amino-3-oxo-4-(phosphooxy)butyric acid which spontaneously decarboxylates to form 3-amino-2-oxopropyl phosphate (AHAP)","","Component of the cytochrome b6-f complex, which mediates electron transfer between photosystem II (PSII) and photosystem I (PSI), cyclic electron flow around PSI, and state transitions","","Condensation of UDP-2,3-diacylglucosamine and 2,3-diacylglucosamine-1-phosphate to form lipid A disaccharide, a precursor of lipid A, a phosphorylated glycolipid that anchors the lipopolysaccharide to the outer membrane of the cell","Poorly processive, error-prone DNA polymerase involved in untargeted mutagenesis. Copies undamaged DNA at stalled replication forks, which arise in vivo from mismatched or misaligned primer ends. These misaligned primers can be extended by PolIV. Exhibits no 3'-5' exonuclease (proofreading) activity. May be involved in translesional synthesis, in conjunction with the beta clamp from PolIII","","Releases the supercoiling and torsional tension of DNA, which is introduced during the DNA replication and transcription, by transiently cleaving and rejoining one strand of the DNA duplex. Introduces a single-strand break via transesterification at a target site in duplex DNA. The scissile phosphodiester is attacked by the catalytic tyrosine of the enzyme, resulting in the formation of a DNA-(5'-phosphotyrosyl)-enzyme intermediate and the expulsion of a 3'-OH DNA strand. The free DNA strand then undergoes passage around the unbroken strand, thus removing DNA supercoils. Finally, in the religation step, the DNA 3'-OH attacks the covalent intermediate to expel the active-site tyrosine and restore the DNA phosphodiester backbone","","An essential GTPase that binds both GDP and GTP, with rapid nucleotide exchange. Plays a role in 16S rRNA processing and 30S ribosomal subunit biogenesis and possibly also in cell cycle regulation and energy metabolism","","","Converts lysophosphatidic acid (LPA) into phosphatidic acid by incorporating acyl moiety at the 2 position","","","","","","","","","","Involved in mRNA degradation. Catalyzes the phosphorolysis of single-stranded polyribonucleotides processively in the 3'- to 5'-direction","Forms an intersubunit bridge (bridge B4) with the 23S rRNA of the 50S subunit in the ribosome","Catalyzes the reversible adenylation of nicotinate mononucleotide (NaMN) to nicotinic acid adenine dinucleotide (NaAD)","Thiol-specific peroxidase that catalyzes the reduction of hydrogen peroxide and organic hydroperoxides to water and alcohols, respectively. Plays a role in cell protection against oxidative stress by detoxifying peroxides and as sensor of hydrogen peroxide-mediated signaling events","","Involved in the system for phosphate transport across the cytoplasmic membrane","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","IGPS catalyzes the conversion of PRFAR and glutamine to IGP, AICAR and glutamate. The HisF subunit catalyzes the cyclization activity that produces IGP and AICAR from PRFAR using the ammonia provided by the HisH subunit","","Required for rescue of stalled ribosomes mediated by trans-translation. Binds to transfer-messenger RNA (tmRNA), required for stable association of tmRNA with ribosomes. tmRNA and SmpB together mimic tRNA shape, replacing the anticodon stem-loop with SmpB. tmRNA is encoded by the ssrA gene; the 2 termini fold to resemble tRNA(Ala) and it encodes a 'tag peptide', a short internal open reading frame. During trans-translation Ala-aminoacylated tmRNA acts like a tRNA, entering the A-site of stalled ribosomes, displacing the stalled mRNA. The ribosome then switches to translate the ORF on the tmRNA; the nascent peptide is terminated with the 'tag peptide' encoded by the tmRNA and targeted for degradation. The ribosome is freed to recommence translation, which seems to be the essential function of trans-translation","Aspartyl-tRNA synthetase with relaxed tRNA specificity since it is able to aspartylate not only its cognate tRNA(Asp) but also tRNA(Asn). Reaction proceeds in two steps: L-aspartate is first activated by ATP to form Asp-AMP and then transferred to the acceptor end of tRNA(Asp/Asn)","","","","Key enzyme in the regulation of glycerol uptake and metabolism. Catalyzes the phosphorylation of glycerol to yield sn-glycerol 3-phosphate","",""],"GO terms: Biological process (P)":["P:cell wall organization; P:peptidoglycan biosynthetic process; P:regulation of cell shape","P:translation","P:SRP-dependent cotranslational protein targeting to membrane, translocation","P:tRNA N1-guanine methylation","P:rRNA processing; P:ribosomal small subunit biogenesis","P:translation",
